            $e->setRootSection($item[19]);
            $e->setQuote($this->getReference($item[20]));

            $om->persist($e);

            $this->addReference('project_unit_'.$key, $e);
        }

        $om->flush();
    }

    public function getOrder()
    {
        return 40;
    }
